pragma solidity 0.7.4;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";

contract PixelToken is ERC721 {

    string constant WHITE_HEX = "#FFFFFF";

  //  enum BidStatus{ SOLD, PENDING, OUTBID }

    struct Exhibit {
        uint16 id;
        address payable owner;
    }

    // store int array and top-left, bottom-right



    struct Pixel {
        bytes32 id;
        bytes32 hexColor;
        uint16 x;
        uint16 y;
    }

    struct Bounds {
        Coord topLeft;
        Coord bottomRight;
    }

    struct Coord {
        uint16 x;
        uint16 y;
    }

    struct Bid {
        address payable fromAddress;
        uint256 amount;
    }

    struct HighestBidResponse {
        uint16 exhibitId;
        address fromAddress;
        uint256 amount;
    }

    struct ExhibitResp {
        uint16 exhibitId;
        address owner;
        uint8[] rgbArray;
        Bounds bounds;
    }

    address payable owner;
    uint16 public pixelFee;
    uint16 private _currentTokenID;
    bytes32[] pixelIds;
    mapping (bytes32 => Pixel) public pixelMap;
    mapping (bytes32 => uint16) public pixelExhibit;
    mapping (uint16 => Exhibit) exhibits;
    mapping (uint16 => Bid) highestBid;
    mapping (uint16 => Bid[]) bidHistory;
    uint16 public maxXPixel;
    uint16 public maxYPixel;
    uint16 public maxPixelsPerExhibit;
    mapping (uint16 => Pixel[]) pixels;


    mapping (uint16 => Bounds) public bounds;
    mapping (uint16 => uint8[]) rgbArray;
    uint16[] allBounds;

    modifier exhibitCreatorOnly(uint16 _id) {
        require(exhibits[_id].owner == msg.sender, "Creator Only");
        _;
    }

    modifier notExhibitCreator(uint16 _id) {
        require(exhibits[_id].owner != msg.sender, "Cannot be Creator");
        _;
    }

    modifier isContractOwner() {
        require(msg.sender == owner, "Owner Only");
        _;
    }

    constructor(address payable _owner, uint16 _maxCoords, 
                uint16 _maxPixels, uint16 _pixelfee) ERC721("Exhibit", "XBT") {
        owner = _owner;
        maxXPixel = _maxCoords;
        maxYPixel = _maxCoords;
        maxPixelsPerExhibit = _maxPixels;
        pixelFee = _pixelfee;
    }

    function getPixels() public view returns(ExhibitResp[] memory) {
        ExhibitResp[] memory _exhibit = new ExhibitResp[](_currentTokenID);
        for (uint16 i = 0; i < _currentTokenID; i++) {
            Exhibit memory creator = exhibits[i];
            uint8[] memory _rgbArray = rgbArray[i];
            Bounds memory _bounds = bounds[i];
            ExhibitResp memory resp = ExhibitResp({
                exhibitId: creator.id,
                owner: creator.owner,
                rgbArray: _rgbArray,
                bounds: _bounds
            });
             _exhibit[i] = resp;
        }
        return _exhibit;
    }

    function create(uint8[] memory _pixels, Bounds memory _bounds) public payable {
        require(msg.sender.balance >= msg.value, "Not enough funds");
        require(_pixels.length <= maxPixelsPerExhibit, "Too many pixels");
        require(validLength(uint16((_pixels.length / 3)), _bounds));
        require(!inBounds(allBounds, _bounds));

        Exhibit memory exhibit = Exhibit({
            id: _currentTokenID,
            owner: msg.sender
        });


        exhibits[_currentTokenID] = exhibit;
        bounds[_currentTokenID] = _bounds;
        rgbArray[_currentTokenID] = _pixels;
        allBounds.push(_bounds.topLeft.x);
        allBounds.push(_bounds.topLeft.y);
        allBounds.push(_bounds.bottomRight.x);
        allBounds.push(_bounds.bottomRight.y);

        owner.transfer(msg.value);
        _mint(msg.sender, _currentTokenID);
        _incrementTokenTypeId();
    }

    function changePixels(uint16 _id, uint8[] memory _rgbArray) public exhibitCreatorOnly(_id) {
        rgbArray[_id] = _rgbArray;
    }

    function placeBid(uint16 _id) notExhibitCreator(_id) public payable {
        Bid memory prevHighest = highestBid[_id];
        require(msg.sender.balance >= msg.value);
        require(msg.value > 0 && msg.value > prevHighest.amount);

        if (prevHighest.fromAddress != address(0)) {
            prevHighest.fromAddress.transfer(prevHighest.amount);
         //   prevHighest.status = BidStatus.OUTBID;
            bidHistory[_id].push(prevHighest);
        }

        Bid memory newHighestBidder = Bid({
            amount: msg.value,
            fromAddress: msg.sender
         //   status: BidStatus.PENDING
        });
        highestBid[_id] = newHighestBidder;
    }

    function acceptBid(uint16 _id) exhibitCreatorOnly(_id) public payable {
        Exhibit memory _exhibit = exhibits[_id];
        _exhibit.owner.transfer(highestBid[_id].amount);
        safeTransferFrom(_exhibit.owner, highestBid[_id].fromAddress, _id);
        _exhibit.owner = highestBid[_id].fromAddress;
        exhibits[_id] = _exhibit;
        Bid memory _highestBid = highestBid[_id];
  //      _highestBid.status = BidStatus.SOLD;
        bidHistory[_id].push(highestBid[_id]);
        delete highestBid[_id];
    }

    function changeAddressForExibit(address payable _address, uint16 _id) exhibitCreatorOnly(_id) public {
        exhibits[_id].owner = _address;
    }

    function getBid(uint16 _id) public view returns(Bid memory) {
        return highestBid[_id];
    }

    function getBidHistoryForExhibit(uint16 _id) public view returns(Bid[] memory) {
        return bidHistory[_id];
    }

    function getAllHighestBids() public view returns(HighestBidResponse[] memory) {
        HighestBidResponse[] memory highestBids = new HighestBidResponse[](_currentTokenID);
        uint16 index = 0;
        for (uint16 i = 0; i < _currentTokenID; i++) {
            if (highestBid[i].amount != 0) {
                Bid memory _bid = highestBid[i];
                HighestBidResponse memory resp = HighestBidResponse({
                    exhibitId: i,
                    fromAddress: _bid.fromAddress,
                    amount: _bid.amount
               //     status: _bid.status
                });
                highestBids[index] = resp;
                index++;
            }
        }
        return highestBids;
    }

    function _incrementTokenTypeId() private  {
        _currentTokenID++;
    }

    function getHashFromCords(uint16 x, uint16 y) internal pure returns (bytes32) {
        return sha256(abi.encodePacked(x, y));
   }

   function inBounds(uint16[] memory _bounds, Bounds memory _newBounds) internal pure returns(bool) {
       for (uint256 i = 0; i < _bounds.length; i += 4) {
           uint16 _topLeftX = _bounds[i];
           uint16 _topLeftY = _bounds[i+1];
           uint16 _bottomRightX = _bounds[i+2];
           uint16 _bottomRightY = _bounds[i+3];

           if (_topLeftX <= _newBounds.topLeft.x 
                    && _topLeftY <= _newBounds.topLeft.y
                    && _bottomRightX > _newBounds.topLeft.x
                    && _bottomRightY > _newBounds.topLeft.y) {
                return true;
           } else if (_topLeftX <= _newBounds.bottomRight.x 
                    && _topLeftY <= _newBounds.bottomRight.y
                    && _bottomRightX > _newBounds.bottomRight.x
                    && _bottomRightY > _newBounds.bottomRight.y) {
                return true;
           } 
       }
       return false;
   }

   function validLength(uint16 length, Bounds memory _bounds) internal pure returns(bool) {
        if (length == (_bounds.bottomRight.x - _bounds.topLeft.x + 1) * (_bounds.bottomRight.y - _bounds.topLeft.y + 1)) {
            return true;
        } 
        return false;
   }


    // Admin
    function changeContactOwner(address payable _owner) public isContractOwner {
        owner = _owner;
    }

    function changeMaxXYPixel(uint16 _maxX, uint16 _maxY) public isContractOwner {
        require(_maxX > maxXPixel && _maxY > maxYPixel);
        maxXPixel = _maxX;
        maxYPixel = _maxY;
    }

    function changePixelFee(uint16 _pixelFee) public isContractOwner {
        pixelFee = _pixelFee;
        // $0.50 / pixel; Use chainlink to update pixelFee as the price of ETH changes
    }

    function changeMaxPixelsPerExhibit(uint16 _max) public isContractOwner {
